import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
    faFileLines, // 중앙 이력서 아이콘
    faHome,      // 홈 아이콘
    faBriefcase, // 구인공고 아이콘
    faCalendarDays, // 프로그램 아이콘
    faUser       // 마이페이지 아이콘
} from '@fortawesome/free-solid-svg-icons';
import { locationData } from '../../constants/locationData';
import { jobCategories } from '../../constants/jobData';
import '../../assets/css/resumeStart.css';

const ResumeStart = () => {
    const navigate = useNavigate();
    const currentYear = new Date().getFullYear();
    
    const [formData, setFormData] = useState({
        birthYear: '',
        birthMonth: '',
        birthDay: '',
        gender: '',
        city: '',
        district: '',
        jobCategory: '',
        jobSubCategory: '',
        customJob: ''
    });
    
    const [age, setAge] = useState(null);
    const [isFormValid, setIsFormValid] = useState(false);

    // 생년월일 옵션 생성
    const years = Array.from({length: 80}, (_, i) => currentYear - 80 + i);
    const months = Array.from({length: 12}, (_, i) => i + 1);
    const days = Array.from({length: 31}, (_, i) => i + 1);

    // 나이 계산
    useEffect(() => {
        if (formData.birthYear && formData.birthMonth && formData.birthDay) {
            const birthDate = new Date(formData.birthYear, formData.birthMonth - 1, formData.birthDay);
            const today = new Date();
            let age = today.getFullYear() - birthDate.getFullYear();
            const monthDiff = today.getMonth() - birthDate.getMonth();
            
            if (monthDiff < 0 || (monthDiff === 0 && today.getDate() < birthDate.getDate())) {
                age--;
            }
            setAge(age);
        }
    }, [formData.birthYear, formData.birthMonth, formData.birthDay]);

    // 폼 유효성 검사
    useEffect(() => {
        const isValid = formData.birthYear && formData.birthMonth && formData.birthDay && 
                       formData.gender && formData.city && formData.district && 
                       (formData.jobCategory && formData.jobSubCategory || formData.customJob);
        setIsFormValid(isValid);
    }, [formData]);

    const handleChange = (field, value) => {
        setFormData(prev => ({
            ...prev,
            [field]: value,
            ...(field === 'city' ? { district: '' } : {}),
            ...(field === 'jobCategory' ? { jobSubCategory: '' } : {})
        }));
    };

    const handleNext = () => {
        navigate('/resume/create', { state: { formData } });
    };

    const handleSkip = () => {
        navigate('/resume/create');
    };

    return (
        <div className="hmk-form-section">
            <div className="hmk-form-header">
                <button 
                    className="hmk-back-button"
                    onClick={() => navigate(-1)}
                >
                    ←
                </button>
            </div>

            <div className="hmk-resume-content">
                <div className="hmk-resume-icon">
                    <FontAwesomeIcon 
                        icon={faFileLines} 
                        size="4x"
                    />
                </div>

                <button 
                    className="hmk-resume-button"
                    onClick={() => navigate('/resume/create')}
                >
                    이력서 작성
                </button>
            </div>

            <div className="hmk-bottom-navigation">
                <button className="nav-item active">
                    <FontAwesomeIcon icon={faHome} />
                    홈
                </button>
                <button className="nav-item">
                    <FontAwesomeIcon icon={faBriefcase} />
                    구인공고
                </button>
                <button className="nav-item">
                    <FontAwesomeIcon icon={faCalendarDays} />
                    프로그램
                </button>
                <button className="nav-item">
                    <FontAwesomeIcon icon={faUser} />
                    마이페이지
                </button>
            </div>
        </div>
    );
};

export default ResumeStart;
